INSERT INTO `_GZX_posts` VALUES (6,1,'2019-03-07 23:52:26','2019-03-07 23:52:26','<!-- wp:paragraph {\"dropCap\":true,\"fontSize\":\"medium\"} -->\n<p class=\"has-drop-cap has-medium-font-size\"><strong>I am a Software Developer</strong>, a graduate of <strong>North Carolina State University College of Engineering </strong>with a<strong> BS in Computer Science</strong>, GO PACK!  I truly enjoyed my time there and was amazed at all the opportunities offered to us as students and rising professionals. I aim to bring those experiences I gained with me and to use them to my advantage wherever applicable.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":117} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/20180526_192934-e1552016153955-1024x768.jpg\" alt=\"\" class=\"wp-image-117\"/><figcaption>circa 2018</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">Whether it be in technology or a simple hobby, I need to be learning something new about this world that we live in.  Constantly, new things are being created and new techniques are being developed and I am relatively new to this scene and aim to find my passion and place in all of this. As it stands, I am enrolled in a Stanford University Machine Learning Course and am working on becoming an IBM Certified Data Scientist.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":126} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/2H2A5826.CR2_-1024x683.jpg\" alt=\"\" class=\"wp-image-126\"/><figcaption>My cat Smudge is a big floof</figcaption></figure>\n<!-- /wp:image -->','Who Am I?','','publish','closed','closed','','home','','','2019-03-12 20:39:58','2019-03-13 01:39:58','',0,'http://box5808.temp.domains/~camerpt3/home/',0,'page','',0),(8,1,'2019-03-07 23:52:51','0000-00-00 00:00:00','','widget_image','','draft','closed','c