ains/~camerpt3/wp-content/uploads/2019/03/20181111_155123.jpg',0,'attachment','image/jpeg',0),(38,1,'2019-03-08 00:05:34','2019-03-08 00:05:34','','cropped-20181111_123644.jpg','','inherit','open','closed','','cropped-20181111_123644-jpg','','','2019-03-08 00:05:34','2019-03-08 00:05:34','',0,'http://box5808.temp.domains/~camerpt3/wp-content/uploads/2019/03/cropped-20181111_123644.jpg',0,'attachment','image/jpeg',0),(39,1,'2019-03-08 00:05:40','2019-03-08 00:05:40','','20181111_155327','','inherit','open','closed','','20181111_155327','','','2019-03-08 00:05:40','2019-03-08 00:05:40','',0,'http://box5808.temp.domains/~camerpt3/wp-content/uploads/2019/03/20181111_155327.jpg',0,'attachment','image/jpeg',0),(343,1,'2019-11-07 15:37:02','2019-11-07 20:37:02','<!-- wp:paragraph -->\n<p>A lot has happened since I made this website and luckily a lot of that was new experiences as I transitioned into a professional setting in a new industry.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I wanted to take some time later to update my portfolio page on new adventures that I\'ve set out on and items that I\'ve finished in the past, but that will take some time.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>What\'s happened to me this year?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Jeez, maybe I need to do this more regularly so I don\'t have to talk about the better part of a year. Instead of going into detail, let me just glance over some general life milestones that have happened to me. (no one said this was purely professional)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>In May of this year (2019) I graduated from <strong>North Carolina State University </strong>with my bachelors degree in Computer Science.</li><li>Just before graduation I received a job offer from IBM to become a Full-Time Software Developer where I would go on to work with Cloud Solutions.</li><li>I celebrated by taking a quick trip to Dublin, Paris, and Madrid. This was my first time in a plane and even just off the east coast of USA.</li><li>Took a plane flight to Mexico with my mom and brother where I caught an illness, super fun.</li><li>In a few weeks I hope to visit my grandpa in Florida :)</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Since my start date with IBM I\'ve been happily working on many cool projects that I hope to be able to reference later in my portfolio. But this seems to be a good stopping point for today.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','My First Post','','publish','open','open','','my-first-post','','','2019-11-07 15:39:52','2019-11-07 20:39:52','',0,'https://www.cameronhetzler.com/?p=343',0,'post','',0),(344,1,'2019-11-07 15:37:02','2019-11-07 20:37:02','<!-- wp:paragraph -->\n<p>A lot has happened since I made this website and luckily a lot of that was new experiences as I transitioned into a professional setting in a new industry.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I wanted to take some time later to update my portfolio page on new adventures that I\'ve set out on and items that I\'ve finished in the past, but that will take some time.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>What\'s happened to me this year?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Jeez, maybe I need to do this more regularly so I don\'t have to talk about the better part of a year. Instead of going into detail, let me just glance over some general life milestones that have happened to me. (no one said this was purely professional)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>In May of this year (2019) I graduated from <strong>North Carolina State University </strong>with my bachelors degree in Computer Science.</li><li>Just before graduation I received a job offer from IBM to become a Full-Time Software Developer where I would go on to work with Cloud Solutions.</li><li>I celebrated by taking a quick trip to Dublin, Paris, and Madrid. This was my first time in a plane and even just off the east coast of USA.</li><li>Took a plane flight to Mexico with my mom and brother where I caught an illness, super fun.</li><li>In a few weeks I hope to visit my grandpa in Florida :)</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Since my start date with IBM I\'ve been happily working on many cool projects that I hope to be able to reference later in my portfolio. But this seems to be a good stopping point for today.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','My First Post','','inherit','closed','closed','','343-revision-v1','','','2019-11-07 15:37:02','2019-11-07 20:37:02','',343,'https://www.cameronhetzler.com/343-revision-v1/',0,'revision','',0),(346,1,'2019-11-07 15:44:04','2019-11-07 20:44:04','','Hetzler_Cameron-removebg copy','','inherit','open','closed','','hetzler_cameron-removebg-copy','','','2019-11-07 15:44:04','2019-11-07 20:44:04','',256,'https://www.cameronhetzler.com/wp-content/uploads/2019/11/Hetzler_Cameron-removebg-copy.png',0,'attachment','image/png',0),(347,1,'2019-11-07 15:44:06','2019-11-07 20:44:06','','Hetzler_Cameron-removebg','','inherit','open','closed','','hetzler_cameron-removebg','','','2019-11-07 15:44:06','2019-11-07 20:44:06','',256,'https://www.cameronhetzler.com/wp-content/uploads/2019/11/Hetzler_Cameron-removebg.png',0,'attachment','image/png',0),(348,1,'2019-11-07 15:44:56','2019-11-07 20:44:56','<!-- wp:jetpack/contact-info -->\n<div class=\"wp-block-jetpack-contact-info\"><!-- wp:jetpack/email {\"email\":\"cjhetz@gmail.com\"} -->\n<div class=\"wp-block-jetpack-email\"><a href=\"mailto:cjhetz@gmail.com\">cjhetz@gmail.com</a></div>\n<!-- /wp:jetpack/email -->\n\n<!-- wp:jetpack/phone {\"phone\":\"+1 (704)-774-7020\"} -->\n<div class=\"wp-block-jetpack-phone\"><a href=\"tel:+17047747020\">+1 (704)-774-7020</a></div>\n<!-- /wp:jetpack/phone -->\n\n<!-- wp:jetpack/address {\"city\"