bsp;.map(i=&gt;(i%11, 1))<br> &nbsp;.groupByKey(_._1)<br> &nbsp;.agg(reduceByKeyAggregator((a:Int, b:Int) =&gt; a+b))<br> &nbsp;.collect()</strong> </pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Example: RDD Statement &gt; Dataframe API</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>RDD API<br> sc.range(10,100)<br> &nbsp;.map(i=&gt;{val j=i%3;(i, if(j==0)i*10 else i*2)})<br> &nbsp;.map(r=&gt;r._1+r._2)<br> &nbsp;.collect()<br><br>Dataframe API<br>spark.range(10,100).selectExpr(\"id as _1\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.selectExpr(\"_1 as _1\", \"if(_1%3==0,_1*10,_1*2) as _2\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.selectExpr(\"_1+_2 as _1\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.collect()</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>RDD UDF &gt; Dataframe SQL Query Grammar</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>Grammar<br>&lt;Program&gt; ::= sc.range(&lt;number&gt;,&lt;number&gt;)&lt;MapOps&gt;.collect()<br>&lt;MapOps&gt; ::= ∅ | &lt;MapOps&gt;.map(&lt;UDF&gt;)<br>&lt;UDF&gt; ::= &lt;identifier&gt; =&gt; &lt;Expression&gt;<br>&lt;Expression&gt; ::= {&lt;ComplexExpr&gt;} | &lt;SimpleExpr&gt;<br>&lt;SimpleExpr&gt; ::= &lt;PureExpr&gt; | (&lt;TupleExpr&gt;)<br>&lt;TupleExpr&gt; ::= &lt;PureExpr&gt;, &lt;PureExpr&gt; | &lt;TupleExpr&gt;, &lt;PureExpr&gt;<br>&lt;ComplexExpr&gt; ::= &lt;SimpleExpr&gt; | &lt;AssignExprs&gt;;&lt;SimpleExpr&gt;<br>&lt;AssignExprs&gt; ::= &lt;AssignExpr&gt; | &lt;AssignExprs&gt;;&lt;AssignExpr&gt;<br>&lt;AssignExpr&gt; ::= val &lt;identifier&gt; = &lt;PureExpr&gt;<br>&lt;PureExpr&gt; ::= &lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;&lt;identifier&gt;.&lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;(&lt;PureExpr&gt;) | <br> &nbsp;&nbsp;&nbsp;&lt;PureExpr&gt; &lt;Op&gt; &lt;PureExpr&gt; |<br> &nbsp;&nbsp;&nbsp;if ( &lt;CompExpr&gt;) &lt;PureExpr&gt; else &lt;PureExpr&gt;<br>&lt;CompExpr&gt; ::= &lt;PureExpr&gt; &lt;Comp&gt; &lt;PureExpr&gt;<br>&lt;Op&gt; ::= + | - | * | %<br>&lt;Comp&gt; ::= == | &lt; | &gt; | != | &gt;= | &lt;=</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Goals and Purpose</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The RDD API is the most expressive one of the three. Dataset API is less expressive than RDD API but it enjoys better performance in most cases, thanks to its compact intermediate data representation. Dataframe API is a subset of Dataset API, and it is the least expressive one. But Dataframe API could achieve the best performance in general because it can exploit the highly optimized Spark SQL.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Since everything you can write with RDD can be expressed with Dataframe, it would be something simple you could to gain free performance. The difficult task is converting legacy code that already uses RDD. This program is meant to convert it automatically for the end user and be a simple and painless way to earn a performance benefit.</p>\n<!-- /wp:paragraph -->','Portfolio','','inherit','closed','closed','','87-revision-v1','','','2019-03-08 11:49:19','2019-03-08 16:49:19','',87,'https://www.cameronhetzler.com/87-revision-v1/',0,'revision','',0),(169,1,'2019-03-08 11:49:55','2019-03-08 16:49:55','<!-- wp:heading -->\n<h2>2019</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4,\"align\":\"center\"} -->\n<h4 style=\"text-align:center\">Cloud processing and Script scheduling on Amazon EC2</h4>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Collect run-time data various Pig Scripts that are run on a Hadoop Map-Reduce system.</li><li>Collect user defined load-curve for some period of time for cluster and frequencies for each script to be run.</li><li>Create a time schedule for when each script is to be run to prevent total system load from exceeding user defined load-curve.</li><li>Run this schedule over the course of a day or week and compare results to model.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"id\":141,\"align\":\"center\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_20190228-150212_Slack-e1552059294666-1024x758.jpg\" alt=\"\" class=\"wp-image-141\"/><figcaption>Example Load-Curve for a 7-day week. X-axis is time in seconds. Y-axis is system load.</figcaption></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:heading -->\n<h2></h2>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\">python3 -m sch \"in.csv\" \"sch.load_func\" [0-1..] ../logdata/*.log<br></pre>\n<!-- /wp:preformatted -->\n\n<p>This application was written using Python 3.7 and utilized a number of inputs.</p>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li>\'in.csv\' - List of scripts and their respective run frequencies</li>\n<li>\'sch.load_func\' - User defined desired load function saved as .py file</li>\n<li>\'[0-1..]\' - Scheduling algorithm choice, we had various implementations</li>\n<li>\'../logdata/*.log\' - Directory that our Pig Script logs were saved</li>\n</ul>\n</li>\n</ul>\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Goals and Purpose</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>As could computing becomes more ubiquitous in the work space it becomes more important utilize all of a systems up-time. You can do this by running scheduled processes outside of peak hours, leaving more resources open for ad hoc jobs. This ends up spreading system load and speeding up job queues during the day and saving the user time and money.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2>2018</h2>\n<!-- /wp:heading -->\n\n<!-- wp:block {\"ref\":168} /-->\n\n<!-- wp:heading {\"level\":4,\"align\":\"center\"} -->\n<h4 style=\"text-align:center\">Spark API Converter</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://spark.apache.org/\">Spark</a> is a popular analytics engine for large-scale data processing. It supports various types of tasks, including generic data analysis, machine learning, stream computing, and graph computing. This project involves three different kinds of Spark APIs that all target generic data analysis. They are RDD API, Dataset API, and Dataframe API respectively.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Although the three APIs are different in expressiveness, most tasks can be expressed in any of them. In this project I translate programs written in RDD API to programs written in Dataset API or Dataframe API. I do the translation automatically via the compiler techniques I\'ve learned, and try to further understand the limitations of these techniques.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>example: RDD Statement &gt; Dataset Query</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>RDD API<br>sc.range(1,10000000)<br> &nbsp;.map(i=&gt;(i%11, 1))<br> &nbsp;.reduceByKey((a:Int, b:Int) =&gt; a+b)<br> &nbsp;.collect()<br><br>Dataset API<br>spark.range(1,10000000)<br> &nbsp;.map(i=&gt;(i%11, 1))<br> &nbsp;.groupByKey(_._1)<br> &nbsp;.agg(reduceByKeyAggregator((a:Int, b:Int) =&gt; a+b))<br> &nbsp;.collect()</strong> </pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Example: RDD Statement &gt; Dataframe API</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>RDD API<br> sc.range(10,100)<br> &nbsp;.map(i=&gt;{val j=i%3;(i, if(j==0)i*10 else i*2)})<br> &nbsp;.map(r=&gt;r._1+r._2)<br> &nbsp;.collect()<br><br>Dataframe API<br>spark.range(10,100).selectExpr(\"id as _1\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.selectExpr(\"_1 as _1\", \"if(_1%3==0,_1*10,_1*2) as _2\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.selectExpr(\"_1+_2 as _1\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.collect()</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>RDD UDF &gt; Dataframe SQL Query Grammar</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>Grammar<br>&lt;Program&gt; ::= sc.range(&lt;number&gt;,&lt;number&gt;)&lt;MapOps&gt;.collect()<br>&lt;MapOps&gt; ::= ∅ | &lt;MapOps&gt;.map(&lt;UDF&gt;)<br>&lt;UDF&gt; ::= &lt;identifier&gt; =&gt; &lt;Expression&gt;<br>&lt;Expression&gt; ::= {&lt;ComplexExpr&gt;} | &lt;SimpleExpr&gt;<br>&lt;SimpleExpr&gt; ::= &lt;PureExpr&gt; | (&lt;TupleExpr&gt;)<br>&lt;TupleExpr&gt; ::= &lt;PureExpr&gt;, &lt;PureExpr&gt; | &lt;TupleExpr&gt;, &lt;PureExpr&gt;<br>&lt;ComplexExpr&gt; ::= &lt;SimpleExpr&gt; | &lt;AssignExprs&gt;;&lt;SimpleExpr&gt;<br>&lt;AssignExprs&gt; ::= &lt;AssignExpr&gt; | &lt;AssignExprs&gt;;&lt;AssignExpr&gt;<br>&lt;AssignExpr&gt; ::= val &lt;identifier&gt; = &lt;PureExpr&gt;<br>&lt;PureExpr&gt; ::= &lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;&lt;identifier&gt;.&lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;(&lt;PureExpr&gt;) | <br> &nbsp;&nbsp;&nbsp;&lt;PureExpr&gt; &lt;Op&gt; &lt;PureExpr&gt; |<br> &nbsp;&nbsp;&nbsp;if ( &lt;CompExpr&gt;) &lt;PureExpr&gt; else &lt;PureExpr&gt;<br>&lt;CompExpr&gt; ::= &lt;PureExpr&gt; &lt;Comp&gt; &lt;PureExpr&gt;<br>&lt;Op&gt; ::= + | - | * | %<br>&lt;Comp&gt; ::= == | &lt; | &gt; | != | &gt;= | &lt;=</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Goals and Purpose</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The RDD API is the most expressive one of the three. Dataset API is less expressive than RDD API but it enjoys better performance in most cases, thanks to its compact intermediate data representation. Dataframe API is a subset of Dataset API, and it is the least expressive one. But Dataframe API could achieve the best performance in general because it can exploit the highly optimized Spark SQL.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Since everything you can write with RDD can be expressed with Dataframe, it would be something simple you could to gain free performance. The difficult task is converting legacy code that already uses RDD. This program is meant to convert it automatically for the end user and be a simple and painless way to earn a performance benefit.</p>\n<!-- /wp:paragraph -->','Portfolio','','inherit','closed','closed','','87-revision-v1','','','2019-03-08 11:49:55','2019-03-08 16:49:55','',87,'https://www.cameronhetzler.com/87-revision-v1/',0,'revision','',0),(174,1,'2019-03-08 12:03:05','2019-03-08 17:03:05','<!-- wp:heading -->\n<h2>2019</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4,\"align\":\"center\"} -->\n<h4 style=\"text-align:center\">Cloud processing and Script scheduling on Amazon EC2</h4>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Collect run-time data various Pig Scripts that are run on a Hadoop Map-Reduce system.</li><li>Collect user defined load-curve for some period of time for cluster and frequencies for each script to be run.</li><li>Create a time schedule for when each script is to be run to prevent total system load from exceeding user defined load-curve.</li><li>Run this schedule over the course of a day or week and compare results to model.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"id\":141,\"align\":\"center\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_20190228-150212_Slack-e1552059294666-1024x758.jpg\" alt=\"\" class=\"wp-image-141\"/><figcaption>Example Load-Curve for a 7-day week. X-axis is time in seconds.