xpressive than RDD API but it enjoys better performance in most cases, thanks to its compact intermediate data representation. Dataframe API is a subset of Dataset API, and it is the least expressive one. But Dataframe API could achieve the best performance in general because it can exploit the highly optimized Spark SQL.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Since everything you can write with RDD can be expressed with Dataframe, it would be something simple you could to gain free performance. The difficult task is converting legacy code that already uses RDD. This program is meant to convert it automatically for the end user and be a simple and painless way to earn a performance benefit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>[/expand]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4,\"align\":\"center\"} -->\n<h4 style=\"text-align:center\">[expand title=\"Dark Squirrels\"]this didn\'t work[/expand]</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>I hope this works</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>[/expand]</h4>\n<!-- /wp:heading -->','Portfolio','','inherit','closed','closed','','87-revision-v1','','','2019-03-08 13:26:56','2019-03-08 18:26:56','',87,'https://www.cameronhetzler.com/87-revision-v1/',0,'revision','',0),(206,1,'2019-03-08 13:31:49','2019-03-08 18:31:49','<!-- wp:heading -->\n<h2>2019</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4,\"align\":\"center\"} -->\n<h4 style=\"text-align:center\">Cloud processing and Script scheduling on Amazon EC2</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>[expand title=\"Expand\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Collect run-time data various Pig Scripts that are run on a Hadoop Map-Reduce system.</li><li>Collect user defined load-curve for some period of time for cluster and frequencies for each script to be run.</li><li>Create a time schedule for when each script is to be run to pr