>&lt;UDF&gt; ::= &lt;identifier&gt; =&gt; &lt;Expression&gt;<br>&lt;Expression&gt; ::= {&lt;ComplexExpr&gt;} | &lt;SimpleExpr&gt;<br>&lt;SimpleExpr&gt; ::= &lt;PureExpr&gt; | (&lt;TupleExpr&gt;)<br>&lt;TupleExpr&gt; ::= &lt;PureExpr&gt;, &lt;PureExpr&gt; | &lt;TupleExpr&gt;, &lt;PureExpr&gt;<br>&lt;ComplexExpr&gt; ::= &lt;SimpleExpr&gt; | &lt;AssignExprs&gt;;&lt;SimpleExpr&gt;<br>&lt;AssignExprs&gt; ::= &lt;AssignExpr&gt; | &lt;AssignExprs&gt;;&lt;AssignExpr&gt;<br>&lt;AssignExpr&gt; ::= val &lt;identifier&gt; = &lt;PureExpr&gt;<br>&lt;PureExpr&gt; ::= &lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;&lt;identifier&gt;.&lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;(&lt;PureExpr&gt;) | <br> &nbsp;&nbsp;&nbsp;&lt;PureExpr&gt; &lt;Op&gt; &lt;PureExpr&gt; |<br> &nbsp;&nbsp;&nbsp;if ( &lt;CompExpr&gt;) &lt;PureExpr&gt; else &lt;PureExpr&gt;<br>&lt;CompExpr&gt; ::= &lt;PureExpr&gt; &lt;Comp&gt; &lt;PureExpr&gt;<br>&lt;Op&gt; ::= + | - | * | %<br>&lt;Comp&gt; ::= == | &lt; | &gt; | != | &gt;= | &lt;=</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:spacer {\"height\":20} -->\n<div style=\"height:20px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Goals and Purpose</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The RDD API is the most expressive one of the three. Dataset API is less expressive than RDD API but it enjoys better performance in most cases, thanks to its compact intermediate data representation. Dataframe API is a subset of Dataset API, and it is the least expressive one. But Dataframe API could achieve the best performance in general because it can exploit the highly optimized Spark SQL.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Since everything you can write with RDD can be expressed with Dataframe, it would be something simple you could to gain free performance. The difficult task is converting legacy code that already uses RDD. This program is meant to convert i