m/wp-content/uploads/2019/03/Screenshot_1.jpg\" alt=\"\" class=\"wp-image-221\"/><figcaption>Title screen of game<br></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This game runs on Microsoft\'s XNA 4.0 platform and is part of a long running personal project of mine. Dark Squirrels is powered by my own game engine that I started building back in High School and I\'ve been improving it ever so slightly when I come back to it to make another game.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":222} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_2.jpg\" alt=\"\" class=\"wp-image-222\"/><figcaption>First level of game. If you hit a fox you acquire damage and you need to collect all the acorns while the screen is scrolling</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>I created this game as a project for my game design course along with three others. Since we were using my personal engine, I needed to take some time to explain how things were set up and how to use the deprecated framework that is XNA.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The game consists of a scrolling screen and requires you to avoid the left side and the foxes while obtaining all of the acorns in time. Levels progress and will be hand made.</p>\n<!-- /wp:paragraph -->\n\n<p>[/expand]</p>','Portfolio','','inherit','closed','closed','','87-revision-v1','','','2019-03-08 13:57:48','2019-03-08 18:57:48','',87,'https://www.cameronhetzler.com/87-revision-v1/',0,'revision','',0),(229,1,'2019-03-08 14:05:24','2019-03-08 19:05:24','<!-- wp:heading -->\n<h2>2019</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>[expand title=\"Cloud processing and Script scheduling on Amazon EC2\" tag=\"h4\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Collect run-time data various Pig Scripts that are run on a Hadoop Map-Reduce system.</li><li>Collect user defined