 or week and compare results to model.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"id\":141,\"align\":\"center\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_20190228-150212_Slack-e1552059294666-1024x758.jpg\" alt=\"\" class=\"wp-image-141\"/><figcaption>Example Load-Curve for a 7-day week. X-axis is time in seconds. Y-axis is system load.</figcaption></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\">python3 -m sch \"in.csv\" \"sch.load_func\" [0-1..] ../logdata/*.log<br></pre>\n<!-- /wp:preformatted -->\n\n<p>This application was written using Python 3.7 and utilized a number of inputs.</p>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li>\'in.csv\' - List of scripts and their respective run frequencies</li>\n<li>\'sch.load_func\' - User defined desired load function saved as .py file</li>\n<li>\'[0-1..]\' - Scheduling algorithm choice, we had various implementations</li>\n<li>\'../logdata/*.log\' - Directory that our Pig Script logs were saved</li>\n</ul>\n</li>\n</ul>\n<p>[expand] I don\'t know how this works</p>\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Goals and Purpose</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>As could computing becomes more ubiquitous in the work space it becomes more important utilize all of a systems up-time. You can do this by running scheduled processes outside of peak hours, leaving more resources open for ad hoc jobs. This ends up spreading system load and speeding up job queues during the day and saving the user time and money.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>[/expand]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2>2018</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>[expand title=\"Spark API Converter\" tag=\"h4\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://spark.apache.org/\">Spark</a> is a popular analytics engine for large-scale data processing. It supports various types of tasks, including generic data analysis, machine learning, stream computing, and graph computing. This project involves three different kinds of Spark APIs that all target generic data analysis. They are RDD API, Dataset API, and Dataframe API respectively.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Although the three APIs are different in expressiveness, most tasks can be expressed in any of them. In this project I translate programs written in RDD API to programs written in Dataset API or Dataframe API. I do the translation automatically via the compiler techniques I\'ve learned, and try to further understand the limitations of these techniques.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>example: RDD Statement &gt; Dataset Query</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>RDD API<br>sc.range(1,10000000)<br> &nbsp;.map(i=&gt;(i%11, 1))<br> &nbsp;.reduceByKey((a:Int, b:Int) =&gt; a+b)<br> &nbsp;.collect()<br><br>Dataset API<br>spark.range(1,10000000)<br> &nbsp;.map(i=&gt;(i%11, 1))<br> &nbsp;.groupByKey(_._1)<br> &nbsp;.agg(reduceByKeyAggregator((a:Int, b:Int) =&gt; a+b))<br> &nbsp;.collect()</strong> </pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Example: RDD Statement &gt; Dataframe API</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>RDD API<br> sc.range(10,100)<br> &nbsp;.map(i=&gt;{val j=i%3;(i, if(j==0)i*10 else i*2)})<br> &nbsp;.map(r=&gt;r._1+r._2)<br> &nbsp;.collect()<br><br>Dataframe API<br>spark.range(10,100).selectExpr(\"id as _1\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.selectExpr(\"_1 as _1\", \"if(_1%3==0,_1*10,_1*2) as _2\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.selectExpr(\"_1+_2 as _1\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.collect()</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>RDD UDF &gt; Dataframe SQL Query Grammar</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>Grammar<br>&lt;Program&gt; ::= sc.range(&lt;number&gt;,&lt;number&gt;)&lt;MapOps&gt;.collect()<br>&lt;MapOps&gt; ::= ∅ | &lt;MapOps&gt;.map(&lt;UDF&gt;)<br>&lt;UDF&gt; ::= &lt;identifier&gt; =&gt; &lt;Expression&gt;<br>&lt;Expression&gt; ::= {&lt;ComplexExpr&gt;} | &lt;SimpleExpr&gt;<br>&lt;SimpleExpr&gt; ::= &lt;PureExpr&gt; | (&lt;TupleExpr&gt;)<br>&lt;TupleExpr&gt; ::= &lt;PureExpr&gt;, &lt;PureExpr&gt; | &lt;TupleExpr&gt;, &lt;PureExpr&gt;<br>&lt;ComplexExpr&gt; ::= &lt;SimpleExpr&gt; | &lt;AssignExprs&gt;;&lt;SimpleExpr&gt;<br>&lt;AssignExprs&gt; ::= &lt;AssignExpr&gt; | &lt;AssignExprs&gt;;&lt;AssignExpr&gt;<br>&lt;AssignExpr&gt; ::= val &lt;identifier&gt; = &lt;PureExpr&gt;<br>&lt;PureExpr&gt; ::= &lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;&lt;identifier&gt;.&lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;(&lt;PureExpr&gt;) | <br> &nbsp;&nbsp;&nbsp;&lt;PureExpr&gt; &lt;Op&gt; &lt;PureExpr&gt; |<br> &nbsp;&nbsp;&nbsp;if ( &lt;CompExpr&gt;) &lt;PureExpr&gt; else &lt;PureExpr&gt;<br>&lt;CompExpr&gt; ::= &lt;PureExpr&gt; &lt;Comp&gt; &lt;PureExpr&gt;<br>&lt;Op&gt; ::= + | - | * | %<br>&lt;Comp&gt; ::= == | &lt; | &gt; | != | &gt;= | &lt;=</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:spacer {\"height\":20} -->\n<div style=\"height:20px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Goals and Purpose</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The RDD API is the most expressive one of the three. Dataset API is less expressive than RDD API but it enjoys better performance in most cases, thanks to its compact intermediate data representation. Dataframe API is a subset of Dataset API, and it is the least expressive one. But Dataframe API could achieve the best performance in general because it can exploit the highly optimized Spark SQL.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Since everything you can write with RDD can be expressed with Dataframe, it would be something simple you could to gain free performance. The difficult task is converting legacy code that already uses RDD. This program is meant to convert it automatically for the end user and be a simple and painless way to earn a performance benefit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>[/expand]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\n\n[expand title=\"Dark Squirrels\" tag=\"h4\"]\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":221} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_1.jpg\" alt=\"\" class=\"wp-image-221\"/><figcaption>Title screen of game<br></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This game runs on Microsoft\'s XNA 4.0 platform using C# and is part of a long running personal project of mine. Dark Squirrels is powered by my own game engine that I started building back in High School and I\'ve been improving it ever so slightly when I come back to it to make another game.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":222} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_2.jpg\" alt=\"\" class=\"wp-image-222\"/><figcaption>First level of game. If you hit a fox you acquire damage and you need to collect all the acorns while the screen is scrolling</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>I created this game as a project for my game design course along with three others. Since we were using my personal engine, I needed to take some time to explain how things were set up and how to use the deprecated framework that is XNA.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The game consists of a scrolling screen and requires you to avoid the left side and the foxes while obtaining all of the acorns in time. Levels progress and will be hand made.</p>\n<!-- /wp:paragraph -->\n\n<p>[/expand]</p>\n\n<!-- wp:paragraph -->\n<p>[expand title=\"Database Management System for Auto Shop\" tag=\"h4\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The goal of the project is to design a relational database application for supporting a chain of car repair and service centers by a company.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pdfemb/pdf-embedder-viewer {\"pdfID\":234,\"url\":\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Report.pdf\",\"width\":\"500\"} -->\n<p class=\"wp-block-pdfemb-pdf-embedder-viewer\"></p>\n<!-- /wp:pdfemb/pdf-embedder-viewer -->\n\n<!-- wp:paragraph -->\n<p>[/expand]</p>\n<!-- /wp:paragraph -->','Portfolio','','inherit','closed','closed','','87-revision-v1','','','2019-03-08 15:16:44','2019-03-08 20:16:44','',87,'https://www.cameronhetzler.com/87-revision-v1/',0,'revision','',0),(240,1,'2019-03-08 15:18:55','2019-03-08 20:18:55','','Screenshot_4','','inherit','open','closed','','screenshot_4','','','2019-03-08 15:18:55','2019-03-08 20:18:55','',87,'https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_4.jpg',0,'attachment','image/jpeg',0),(243,1,'2019-03-08 15:22:05','2019-03-08 20:22:05','<!-- wp:heading -->\n<h2>2019</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>[expand title=\"Cloud processing and Script scheduling on Amazon EC2\" tag=\"h4\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Collect run-time data various Pig Scripts that are run on a Hadoop Map-Reduce system.</li><li>Collect user defined load-curve for some period of time for cluster and frequencies for each script to be run.</li><li>Create a time schedule for when each script is to be run to prevent total system load from exceeding user defined load-curve.</li><li>Run this schedule over the course of a day or week and compare results to model.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"id\":141,\"align\":\"center\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_20190228-150212_Slack-e1552059294666-1024x758.jpg\" alt=\"\" class=\"wp-image-141\"/><figcaption>Example Load-Curve for a 7-day week. X-axis is time in seconds. Y-axis is system load.</figcaption></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\">python3 -m sch \"in.csv\" \"sch.load_func\" [0-1..] ../logdata/*.log<br></pre>\n<!-- /wp:preformatted -->\n\n<p>This application was written using Python 3.7 and utilized a number of inputs.</p>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li>\'in.csv\' - List of scripts and their respective run frequencies</li>\n<li>\'sch.load_func\' - User defined desired load function saved as .py file</li>\n<li>\'[0-1..]\' - Scheduling algorithm choice, we had various implementations</li>\n<li>\'../logdata/*.log\' - Directory that our Pig Script logs were saved</li>\n</ul>\n</li>\n</ul>\n<p>[expand] I don\'t know how this works</p>\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Goals and Purpose</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>As could computing becomes more ubiquitous in the work space it becomes more important utilize all of a systems up-time. You can do this by running scheduled processes outside of peak hours, leaving more resources open for ad hoc jobs. This ends up spreading system load and speeding up job queues during the day and saving the user time and money.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>[/expand]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2>2018</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>[expand title=\"Spark API Converter\" tag=\"h4\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://spark.apache.org/\">Spark</a> is a popular analytics engine for large-scale data processing. It supports various types of tasks, including generic data analysis, machine learning, stream computing, and graph computing. This project involves three different kinds of Spark APIs that all target generic data analysis. They are RDD API, Dataset API, and Dataframe API respectively.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Although the three APIs are different in expressiveness, most tasks can be expressed in any of them. In this project I translate programs written in RDD API to programs written in Dataset API or Dataframe API. I do the translation automatically via the compiler techniques I\'ve learned, and try to further understand the limitations of these techniques.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>example: RDD Statement &gt; Dataset Query</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>RDD API<br>sc.range(1,10000000)<br> &nbsp;.map(i=&gt;(i%11, 1))<br> &nbsp;.reduceByKey((a:Int, b:Int) =&gt; a+b)<br> &nbsp;.collect()<br><br>Dataset API<br>spark.range(1,10000000)<br> &nbsp;.map(i=&gt;(i%11, 1))<br> &nbsp;.groupByKey(_._1)<br> &nbsp;.agg(reduceByKeyAggregator((a:Int, b:Int) =&gt; a+b))<br> &nbsp;.collect()</strong> </pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Example: RDD Statement &gt; Dataframe API</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>RDD API<br> sc.range(10,100)<br> &nbsp;.map(i=&gt;{val j=i%3;(i, if(j==0)i*10 else i*2)})<br> &nbsp;.map(r=&gt;r._1+r._2)<br> &nbsp;.collect()<br><br>Dataframe API<br>spark.range(10,100).selectExpr(\"id as _1\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.selectExpr(\"_1 as _1\", \"if(_1%3==0,_1*10,_1*2) as _2\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.selectExpr(\"_1+_2 as _1\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.collect()</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>RDD UDF &gt; Dataframe SQL Query Grammar</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>Grammar<br>&lt;Program&gt; ::= sc.range(&lt;number&gt;,&lt;number&gt;)&lt;MapOps&gt;.collect()<br>&lt;MapOps&gt; ::= ∅ | &lt;MapOps&gt;.map(&lt;UDF&gt;)<br>&lt;UDF&gt; ::= &lt;identifier&gt; =&gt; &lt;Expression&gt;<br>&lt;Expression&gt; ::= {&lt;ComplexExpr&gt;} | &lt;SimpleExpr&gt;<br>&lt;SimpleExpr&gt; ::= &lt;PureExpr&gt; | (&lt;TupleExpr&gt;)<br>&lt;TupleExpr&gt; ::= &lt;PureExpr&gt;, &lt;PureExpr&gt; | &lt;TupleExpr&gt;, &lt;PureExpr&gt;<br>&lt;ComplexExpr&gt; ::= &lt;SimpleExpr&gt; | &lt;AssignExprs&gt;;&lt;SimpleExpr&gt;<br>&lt;AssignExprs&gt; ::= &lt;AssignExpr&gt; | &lt;AssignExprs&gt;;&lt;AssignExpr&gt;<br>&lt;AssignExpr&gt; ::= val &lt;identifier&gt; = &lt;PureExpr&gt;<br>&lt;PureExpr&gt; ::= &lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;&lt;identifier&gt;.&lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;(&lt;PureExpr&gt;) | <br> &nbsp;&nbsp;&nbsp;&lt;PureExpr&gt; &lt;Op&gt; &lt;PureExpr&gt; |<br> &nbsp;&nbsp;&nbsp;if ( &lt;CompExpr&gt;) &lt;PureExpr&gt; else &lt;PureExpr&gt;<br>&lt;CompExpr&gt; ::= &lt;PureExpr&gt; &lt;Comp&gt; &lt;PureExpr&gt;<br>&lt;Op&gt; ::= + | - | * | %<br>&lt;Comp&gt; ::= == | &lt; | &gt; | != | &gt;= | &lt;=</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:spacer {\"height\":20} -->\n<div style=\"height:20px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Goals and Purpose</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The RDD API is the most expressive one of the three. Dataset API is less expressive than RDD API but it enjoys better performance in most cases, thanks to its compact intermediate data representation. Dataframe API is a subset of Dataset API, and it is the least expressive one. But Dataframe API could achieve the best performance in general because it can exploit the highly optimized Spark SQL.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Since everything you can write with RDD can be expressed with Dataframe, it would be something simple you could to gain free performance. The difficult task is converting legacy code that already uses RDD. This program is meant to convert it automatically for the end user and be a simple and painless way to earn a performance benefit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>[/expand]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\n\n[expand title=\"Dark Squirrels\" tag=\"h4\"]\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":221} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_1.jpg\" alt=\"\" class=\"wp-image-221\"/><figcaption>Title screen of game<br></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This game runs on Microsoft\'s XNA 4.0 platform using C# and is part of a long running personal project of mine. Dark Squirrels is powered by my own game engine that I started building back in High School and I\'ve been improving it ever so slightly when I come back to it to make another game.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":222} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_2.jpg\" alt=\"\" class=\"wp-image-222\"/><figcaption>First level of game. If you hit a fox you acquire damage and you need to collect all the acorns while the screen is scrolling</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>I created this game as a project for my game design course along with three others. Since we were using my personal engine, I needed to take some time to explain how things were set up and how to use the deprecated framework that is XNA.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The game consists of a scrolling screen and requires you to avoid the left side and the foxes while obtaining all of the acorns in time. Levels progress and will be hand made.</p>\n<!-- /wp:paragraph -->\n\n<p>[/expand]</p>\n\n<!-- wp:paragraph -->\n<p>[expand title=\"Database Management System for Auto Shop\" tag=\"h4\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The goal of the project is to design a relational database application for supporting a chain of car repair and service centers by a company.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Below is our write up on the purpose and our implementation of the software.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pdfemb/pdf-embedder-viewer {\"pdfID\":234,\"url\":\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Report.pdf\",\"width\":\"500\"} -->\n<p class=\"wp-block-pdfemb-pdf-embedder-viewer\"></p>\n<!-- /wp:pdfemb/pdf-embedder-viewer -->\n\n<!-- wp:paragraph -->\n<p>In the end, we created an online console application that could be hosted and logged into by an autoshop manager who could then create reservations for customers, manage part inventory, order new parts manually and automatically.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":240} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_4-1024x692.jpg\" alt=\"\" class=\"wp-image-240\"/><figcaption>Our teams UML design diagram for our implemented system. All code can be found in my csc440_project repository on GitHub</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>[/expand]</p>\n<!-- /wp:paragraph -->','Portfolio','','inherit','closed','closed','','87-revision-v1','','','2019-03-08 15:22:05','2019-03-08 20:22:05','',87,'https://www.cameronhetzler.com/87-revision-v1/',0,'revision','',0),(242,1,'2019-03-08 15:20:01','2019-03-08 20:20:01','<!-- wp:heading -->\n<h2>2019</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>[expand title=\"Cloud processing and Script scheduling on Amazon EC2\" tag=\"h4\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Collect run-time data various Pig Scripts that are run on a Hadoop Map-Reduce system.</li><li>Collect user defined load-curve for some period of time for cluster and frequencies for each script to be run.</li><li>Create a time schedule for when each script is to be run to prevent total system load from exceeding user defined load-curve.</li><li>Run this schedule over the course of a day or week and compare results to model.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"id\":141,\"align\":\"center\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_20190228-150212_Slack-e1552059294666-1024x758.jpg\" alt=\"\" class=\"wp-image-141\"/><figcaption>Example Load-Curve for a 7-day week. X-axis is time in seconds. Y-axis is system load.</figcaption></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\">python3 -m sch \"in.csv\" \"sch.load_func\" [0-1..] ../logdata/*.log<br></pre>\n<!-- /wp:preformatted -->\n\n<p>This application was written using Python 3.7 and utilized a number of inputs.</p>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li>\'in.csv\' - List of scripts and their respective run frequencies</li>\n<li>\'sch.load_func\' - User defined desired load function saved as .py file</li>\n<li>\'[0-1..]\' - Scheduling algorithm choice, we had various implementations</li>\n<li>\'../logdata/*.log\' - Directory that our Pig Script logs were saved</li>\n</ul>\n</li>\n</ul>\n<p>[expand] I don\'t know how this works</p>\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Goals and Purpose</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>As could computing becomes more ubiquitous in the work space it becomes more important utilize all of a systems up-time. You can do this by running scheduled processes outside of peak hours, leaving more resources open for ad hoc jobs. This ends up spreading system load and speeding up job queues during the day and saving the user time and money.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>[/expand]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading -->\n<h2>2018</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>[expand title=\"Spark API Converter\" tag=\"h4\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://spark.apache.org/\">Spark</a> is a popular analytics engine for large-scale data processing. It supports various types of tasks, including generic data analysis, machine learning, stream computing, and graph computing. This project involves three different kinds of Spark APIs that all target generic data analysis. They are RDD API, Dataset API, and Dataframe API respectively.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Although the three APIs are different in expressiveness, most tasks can be expressed in any of them. In this project I translate programs written in RDD API to programs written in Dataset API or Dataframe API. I do the translation automatically via the compiler techniques I\'ve learned, and try to further understand the limitations of these techniques.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>example: RDD Statement &gt; Dataset Query</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>RDD API<br>sc.range(1,10000000)<br> &nbsp;.map(i=&gt;(i%11, 1))<br> &nbsp;.reduceByKey((a:Int, b:Int) =&gt; a+b)<br> &nbsp;.collect()<br><br>Dataset API<br>spark.range(1,10000000)<br> &nbsp;.map(i=&gt;(i%11, 1))<br> &nbsp;.groupByKey(_._1)<br> &nbsp;.agg(reduceByKeyAggregator((a:Int, b:Int) =&gt; a+b))<br> &nbsp;.collect()</strong> </pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Example: RDD Statement &gt; Dataframe API</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>RDD API<br> sc.range(10,100)<br> &nbsp;.map(i=&gt;{val j=i%3;(i, if(j==0)i*10 else i*2)})<br> &nbsp;.map(r=&gt;r._1+r._2)<br> &nbsp;.collect()<br><br>Dataframe API<br>spark.range(10,100).selectExpr(\"id as _1\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.selectExpr(\"_1 as _1\", \"if(_1%3==0,_1*10,_1*2) as _2\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.selectExpr(\"_1+_2 as _1\")<br> &nbsp;&nbsp;&nbsp;&nbsp;.collect()</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>RDD UDF &gt; Dataframe SQL Query Grammar</h5>\n<!-- /wp:heading -->\n\n<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\"> <br><strong>Grammar<br>&lt;Program&gt; ::= sc.range(&lt;number&gt;,&lt;number&gt;)&lt;MapOps&gt;.collect()<br>&lt;MapOps&gt; ::= ∅ | &lt;MapOps&gt;.map(&lt;UDF&gt;)<br>&lt;UDF&gt; ::= &lt;identifier&gt; =&gt; &lt;Expression&gt;<br>&lt;Expression&gt; ::= {&lt;ComplexExpr&gt;} | &lt;SimpleExpr&gt;<br>&lt;SimpleExpr&gt; ::= &lt;PureExpr&gt; | (&lt;TupleExpr&gt;)<br>&lt;TupleExpr&gt; ::= &lt;PureExpr&gt;, &lt;PureExpr&gt; | &lt;TupleExpr&gt;, &lt;PureExpr&gt;<br>&lt;ComplexExpr&gt; ::= &lt;SimpleExpr&gt; | &lt;AssignExprs&gt;;&lt;SimpleExpr&gt;<br>&lt;AssignExprs&gt; ::= &lt;AssignExpr&gt; | &lt;AssignExprs&gt;;&lt;AssignExpr&gt;<br>&lt;AssignExpr&gt; ::= val &lt;identifier&gt; = &lt;PureExpr&gt;<br>&lt;PureExpr&gt; ::= &lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;&lt;identifier&gt;.&lt;identifier&gt; | <br> &nbsp;&nbsp;&nbsp;(&lt;PureExpr&gt;) | <br> &nbsp;&nbsp;&nbsp;&lt;PureExpr&gt; &lt;Op&gt; &lt;PureExpr&gt; |<br> &nbsp;&nbsp;&nbsp;if ( &lt;CompExpr&gt;) &lt;PureExpr&gt; else &lt;PureExpr&gt;<br>&lt;CompExpr&gt; ::= &lt;PureExpr&gt; &lt;Comp&gt; &lt;PureExpr&gt;<br>&lt;Op&gt; ::= + | - | * | %<br>&lt;Comp&gt; ::= == | &lt; | &gt; | != | &gt;= | &lt;=</strong><br></pre>\n<!-- /wp:preformatted -->\n\n<!-- wp:spacer {\"height\":20} -->\n<div style=\"height:20px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Goals and Purpose</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The RDD API is the most expressive one of the three. Dataset API is less expressive than RDD API but it enjoys better performance in most cases, thanks to its compact intermediate data representation. Dataframe API is a subset of Dataset API, and it is the least expressive one. But Dataframe API could achieve the best performance in general because it can exploit the highly optimized Spark SQL.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Since everything you can write with RDD can be expressed with Dataframe, it would be something simple you could to gain free performance. The difficult task is converting legacy code that already uses RDD. This program is meant to convert it automatically for the end user and be a simple and painless way to earn a performance benefit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>[/expand]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\n\n[expand title=\"Dark Squirrels\" tag=\"h4\"]\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":221} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_1.jpg\" alt=\"\" class=\"wp-image-221\"/><figcaption>Title screen of game<br></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>This game runs on Microsoft\'s XNA 4.0 platform using C# and is part of a long running personal project of mine. Dark Squirrels is powered by my own game engine that I started building back in High School and I\'ve been improving it ever so slightly when I come back to it to make another game.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":222} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_2.jpg\" alt=\"\" class=\"wp-image-222\"/><figcaption>First level of game. If you hit a fox you acquire damage and you need to collect all the acorns while the screen is scrolling</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>I created this game as a project for my game design course along with three others. Since we were using my personal engine, I needed to take some time to explain how things were set up and how to use the deprecated framework that is XNA.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The game consists of a scrolling screen and requires you to avoid the left side and the foxes while obtaining all of the acorns in time. Levels progress and will be hand made.</p>\n<!-- /wp:paragraph -->\n\n<p>[/expand]</p>\n\n<!-- wp:paragraph -->\n<p>[expand title=\"Database Management System for Auto Shop\" tag=\"h4\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The goal of the project is to design a relational database application for supporting a chain of car repair and service centers by a company.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Below is our write up on the purpose and our implementation of the software.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:pdfemb/pdf-embedder-viewer {\"pdfID\":234,\"url\":\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Report.pdf\",\"width\":\"500\"} -->\n<p class=\"wp-block-pdfemb-pdf-embedder-viewer\"></p>\n<!-- /wp:pdfemb/pdf-embedder-viewer -->\n\n<!-- wp:image {\"id\":240} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/Screenshot_4-1024x692.jpg\" alt=\"\" class=\"wp-image-240\"/><figcaption>Our teams UML design diagram for our implemented system. All code can be found in my csc440_project repository on GitHub</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>[/expand]</p>\n<!-- /wp:paragraph -->','Portfolio','','inherit','closed','closed','','87-revision-v1','','','2019-03-08 15:20:01','2019-03-08 20:20:01','',87,'https://www.cameronhetzler.com/87-revision-v1/',0,'revision','',0),(244,1,'2019-03-08 15:31:20','0000-00-00 00:00:00','','','','draft','closed','closed','','','','','2019-03-08 15:31:20','2019-03-08 20:31:20','',0,'https://www.cameronhetzler.com/?post_type=pdf_lv&#038;p=244',0,'pdf_lv','',0),(247,1,'2019-03-08 15:34:39','2019-03-08 20:34:39','<!-- wp:paragraph {\"dropCap\":true,\"fontSize\":\"medium\"} -->\n<p class=\"has-drop-cap has-medium-font-size\"><strong>I am a Software Developer</strong>, a graduate of North Carolina State University Engineering College with a BS in Computer Science, GO PACK!  I truly enjoyed my time there and was amazed at all the opportunities offered to us as students and rising professionals. I aim to bring those experiences I gained with me and to use them to my advantage wherever applicable.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":117} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/20180526_192934-e1552016153955-1024x768.jpg\" alt=\"\" class=\"wp-image-117\"/><figcaption>circa 2018</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">\n\n Whether it be in technology or a simple hobby, I need to be learning something new about this world that we live in.  Constantly, new things are being created and new techniques are being developed and I am relatively new to this scene and aim to find my passion and place in all of this. Just to name a few things, in the past year alone I\'ve spent countless weeks looking into: Bicycles, Apache Hadoop, Microphones, Set Recording, Machine Learning, and Digital Art. \n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":126} -->\n<figure class=\"wp-block-image\"><img src=\"https://www.cameronhetzler.com/wp-content/uploads/2019/03/2H2A582