 now.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The name of this month has turn out to be \"Hobbies\". I want to work on my work life balance and the stress of my environment\'s total breakdown got me stressed out and made me realize that I need to focus on myself a bit more. I have been going on outings with work friends that I\'ve met at programming events and I\'m super pleased to say that they are all great people! We ended up going to the Carolina Renaissance Festival together and it sparked interest in me to get into two different items.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Renaissance Cosplay: Gosh, every year that I go to the Carolina RenFest you see people that are dressed up in these extraordinary outfits and I want to look into assembling my own (cheap at first) outfit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Archery: When I was in BSA, I found great pleasure in spending my time at the archery range while at camp and ended up making my own bow for when I went home. I haven\'t touched the hobby since I quit BSA and this reminded me that I am my own adult now and that \"Heck, if I want to do something I have only just to google it.\" Now I have plans to start classes in late December but until then, I\'ll look into a personal coach and or just hitting the range with rental equipment. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:paragraph -->\n<p>On a different note. I am excited that later this week I will be taking some time to go see my grandpa. What is important to me is that this is the first time that I will be taking a plane flight by myself to go out of my way to see him and it sounds like a lot of fun to me.</p>\n<!-- /wp:paragraph -->','November Update: Hobbies','','publish','open','open','','november-update-hobbies','','','2019-11-20 13:25:26','2019-11-20 18:25:26','',0,'https://www.cameronhetzler.com/?p=383',0,'post','',0),(384,1,'2019-11-20 13:25:26','2019-11-20 18:25:26','<!-- wp:paragraph -->\n<p>Well, it\'s not even the end of November yet so just ignore that aspect.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I\'ve spent a lot of time this month needlessly working on my laptop\'s environment and try to get it to work correctly. MacOS 10.15 threw a huge fit and broke a lot of what I need to actually do my job but I am happy to say that that is past me now.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The name of this month has turn out to be \"Hobbies\". I want to work on my work life balance and the stress of my environment\'s total breakdown got me stressed out and made me realize that I need to focus on myself a bit more. I have been going on outings with work friends that I\'ve met at programming events and I\'m super pleased to say that they are all great people! We ended up going to the Carolina Renaissance Festival together and it sparked interest in me to get into two different items.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Renaissance Cosplay: Gosh, every year that I go to the Carolina RenFest you see people that are dressed up in these extraordinary outfits and I want to look into assembling my own (cheap at first) outfit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Archery: When I was in BSA, I found great pleasure in spending my time at the archery range while at camp and ended up making my own bow for when I went home. I haven\'t touched the hobby since I quit BSA and this reminded me that I am my own adult now and that \"Heck, if I want to do something I have only just to google it.\" Now I have plans to start classes in late December but until then, I\'ll look into a personal coach and or just hitting the range with rental equipment. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:paragraph -->\n<p>On a different note. I am excited that later this week I will be taking some time to go see my grandpa. What is important to me is that this is the first time that I will be taking a plane flight by myself to go out of my way to see him and it sounds like a lot of fun to me.</p>\n<!-- /wp:paragraph -->','November Update: Hobbies','','inherit','closed','closed','','383-revision-v1','','','2019-11-20 13:25:26','2019-11-20 18:25:26','',383,'https://www.cameronhetzler.com/383-revision-v1/',0,'revision','',0),(385,1,'2019-11-20 13:28:55','2019-11-20 18:28:55','<!-- wp:paragraph -->\n<p>It seems that I will need to be focusing on more \"Serverless\" work and how it works. This month will mark the start of that training and I am excited to see where it ends up taking me.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This won\'t be much of a post but I hope to have a follow up to this soon in the coming month (or two, after Christmas).</p>\n<!-- /wp:paragraph -->','Serverless Start','','publish','open','open','','serverless-start','','','2019-11-20 13:28:55','2019-11-20 18:28:55','',0,'https://www.cameronhetzler.com/?p=385',0,'post','',0),(386,1,'2019-11-20 13:28:55','2019-11-20 18:28:55','<!-- wp:paragraph -->\n<p>It seems that I will need to be focusing on more \"Serverless\" work and how it works. This month will mark the start of that training and I am excited to see where it ends up taking me.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This won\'t be much of a post but I hope to have a follow up to this soon in the coming month (or two, after Christmas).</p>\n<!-- /wp:paragraph -->','Serverless Start','','inherit','closed','closed','','385-revision-v1','','','2019-11-20 13:28:55','2019-11-20 18:28:55','',385,'https://www.cameronhetzler.com/385-revision-v1/',0,'revision','',0),(388,0,'2019-12-11 16:51:12','0000-00-00 00:00:00','','image-sitemap-1.xml','','draft','closed','closed','','','','','2020-01-08 07:21:42','2020-01-08 12:21:42','',0,'https://www.cameronhetzler.com/?p=3